import React from "react";
import styles from "./NavBar.module.css";
const NavBar = () => {
  return;
  <header>
    <nav className={styles.navbar}>
      <h1>Wiki WHO</h1>
      <ul>
        <li>MERCH</li>
        <li>HUBS</li>
        <li>EPISODES</li>
        <li>CONTACT</li>
      </ul>
    </nav>
  </header>;
};

export default NavBar;
